import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Button';
import './App.css';

import Navigation from './files/Navigation.js';
import AppBody from './files/AppBody.js';

function App() {
  return (
    <>
    <Navigation />
    <Container>
      <AppBody />
    </Container>
    </>
  );
};

export default App;
